import "./Pagination.css";
import { FaAngleLeft } from "react-icons/fa";

const Pagination = ({ goToNextPage, goToPreviousPage }) => {
  return (
    <div className="pagination">
      <div className="pagintaion__previous">
        <button className="pagination__previousButton">
          <FaAngleLeft size="25px" style={{ marginRight: "20px" }} />
          <h4>Previous</h4>
        </button>
        <button className="pagination__nextButton">
          <h4>Previous</h4>
          <FaAngleLeft size="25px" style={{ marginRight: "20px" }} />
        </button>
      </div>
    </div>
  );
};

export default Pagination;
